import org.junit.jupiter.api.BeforeAll
import org.junit.jupiter.api.Test
import java.time.Instant
import kotlin.test.*

class RestSignatureServiceTest {
    @Test
    fun `Should determine the data that needs to be signed from an input`() {
        val signInput = restSignatureService.determineSignInput(
            origData = OrigData(
                value = FILE_CONTENT.toByteArray(),
                mimeType = "application/pdf",
                name = FILE_NAME
            ),
            signMode = SignMode.DOCUMENT,
            kid = KID_REST,
            signatureConfiguration = SignatureConfiguration(
                signatureParameters = SignatureParameters()
            )
        )

        assertNotNull(signInput)
        assertNotNull(signInput.input)
        assertEquals(com.sphereon.vdx.ades.rest.client.model.SignMode.valueOf(signInput.signMode.name), com.sphereon.vdx.ades.rest.client.model.SignMode.DOCUMENT)
        assertEquals(com.sphereon.vdx.ades.rest.client.model.DigestAlgorithm.valueOf(signInput.digestAlgorithm!!.name), DigestAlgorithm.SHA256)
        assertNotNull(signInput.signingDate)
        assertEquals(signInput.name, FILE_NAME)
        assertNotNull(signInput.binding)
        assertEquals(signInput.binding.kid, KID_REST)
        assertEquals(signInput.binding.keyProviderId, KID_REST)
    }

    @Test
    fun `should create a digest value from an input`() {
        val digest = restSignatureService.digest(
            SignInput(
                name = FILE_NAME,
                input = FILE_CONTENT.toByteArray(),
                signMode = SignMode.DOCUMENT,
                digestAlgorithm = DigestAlg.SHA256,
                signingDate = kotlinx.datetime.Instant.fromEpochSeconds(1658138695),
                binding = com.sphereon.vdx.ades.model.ConfigKeyBinding(
                    kid = KID_REST,
                    keyProviderId = KID_REST
                )
            )
        )

        assertNotNull(digest)
        assertEquals(digest.name, FILE_NAME)
        assertEquals(com.sphereon.vdx.ades.rest.client.model.SignMode.valueOf(digest.signMode.name), com.sphereon.vdx.ades.rest.client.model.SignMode.DIGEST)
        assertNotNull(digest.binding)
        assertEquals(digest.binding.kid, KID_REST)
        assertEquals(digest.binding.keyProviderId, KID_REST)
    }

    @Test
    fun `should merge the original data with a created signature`() {
        val signOutput = restSignatureService.sign(
            origData = OrigData(
                name = FILE_NAME,
                mimeType = "application/pdf",
                value = FILE_CONTENT.toByteArray(),
            ),
            signature = Signature(
                value = "".toByteArray(),
                algorithm = SignatureAlg.RSA_RAW,
                signMode = SignMode.DIGEST,
                keyEntry = KeyEntry(
                    kid = KID_REST,
                    encryptionAlgorithm = CryptoAlg.RSA,
                    publicKey = Key(
                        value = "".toByteArray(),
                        algorithm = CryptoAlg.RSA,
                        format = "X.509",
                    ),
                    certificate = Certificate(
                        value = "".toByteArray(),
                        serialNumber = "302503097311715737064467329723821046857",
                        issuerDN = "CN=Ensured Document Signing CA, O=Ensured B.V., L=Heerhugowaard, ST=Noord-Holland, C=NL",
                        subjectDN = "EMAILADDRESS=signature@esignum.io, CN=Afdeling beheer, OU=Afdeling beheer, O=Sphereon B.V., ST=Utrecht, C=NL",
                        notBefore = kotlinx.datetime.Instant.fromEpochSeconds(1658138695),
                        notAfter = kotlinx.datetime.Instant.fromEpochSeconds(1658138695),
                        fingerPrint = "1234"
                    ),
                ),
                date = kotlinx.datetime.Instant.fromEpochSeconds(1658138695),
                providerId = KID_REST
            ),
            signatureConfiguration = SignatureConfiguration(
                signatureParameters = SignatureParameters()
            )
        )

        assertNotNull(signOutput)
    }

    companion object {
        private val KID_REST: String = "rest"
        private val FILE_NAME = "test.pdf"
        private val FILE_CONTENT = ""
        private lateinit var restSignatureService: RestSignatureService

        private fun constructRestClientConfig(baseUrl: String? = "http://mocked"): RestClientConfig {
            return RestClientConfig(
                baseUrl = baseUrl
            )
        }

        private fun constructKeyProviderSettings(
            password: String = "password",
            enableCache: Boolean = false
        ): KeyProviderSettings {
            return KeyProviderSettings(
                id = "rest",
                config = KeyProviderConfig(
                    cacheEnabled = enableCache,
                    type = KeyProviderType.REST
                ),
                passwordInputCallback = PasswordInputCallback(password = password.toCharArray())
            )
        }

        private fun setupSignatureProviderMock(): RestSignatureService {
            val signingApiMock = mockk<SigningApi>()

            every {
                signingApiMock.determineSignInput(DetermineSignInput()
                    .origData(com.sphereon.vdx.ades.rest.client.model.OrigData()
                        .name(FILE_NAME)
                        .content(FILE_CONTENT.toByteArray())
                        .mimeType("application/pdf")
                    )
                    .signMode(com.sphereon.vdx.ades.rest.client.model.SignMode.DOCUMENT)
                    .binding(
                        ConfigKeyBinding()
                            .kid(KID_REST)
                            .keyProviderId(KID_REST)
                    ))
            } returns JSON.getDefault().mapper.readValue(this::class.java.classLoader.getResource("determineSignInputResponse.json"), DetermineSignInputResponse::class.java)

            every {
                signingApiMock.digest(
                    Digest().signInput(
                        com.sphereon.vdx.ades.rest.client.model.SignInput()
                            .name(FILE_NAME)
                            .input(FILE_CONTENT.toByteArray())
                            .signMode(com.sphereon.vdx.ades.rest.client.model.SignMode.DOCUMENT)
                            .digestAlgorithm(DigestAlgorithm.SHA256)
                            .signingDate(Instant.ofEpochSecond(1658138695))
                            .binding(ConfigKeyBinding()
                                .kid(KID_REST)
                                .keyProviderId(KID_REST)
                            )
                    )
                )
            } returns JSON.getDefault().mapper.readValue(this::class.java.classLoader.getResource("digestResponse.json"), Digest::class.java)

            every {
                signingApiMock.mergeSignature(
                    MergeSignature()
                        .origData(com.sphereon.vdx.ades.rest.client.model.OrigData()
                            .name(FILE_NAME)
                            .content(FILE_CONTENT.toByteArray())
                            .mimeType("application/pdf")
                        )
                        .signature(com.sphereon.vdx.ades.rest.client.model.Signature()
                            .value("".toByteArray())
                            .algorithm(SignatureAlgorithm.RSA_RAW)
                            .signMode(com.sphereon.vdx.ades.rest.client.model.SignMode.DIGEST)
                            .keyEntry(com.sphereon.vdx.ades.rest.client.model.KeyEntry()
                                .kid(KID_REST)
                                .encryptionAlgorithm(CryptoAlgorithm.RSA)
                                .publicKey(com.sphereon.vdx.ades.rest.client.model.Key()
                                    .value("".toByteArray())
                                    .format("X.509")
                                    .algorithm(CryptoAlgorithm.RSA)
                                )
                                .providerId(KID_REST)
                                .certificate(com.sphereon.vdx.ades.rest.client.model.Certificate()
                                    .value("".toByteArray())
                                    .fingerPrint("1234")
                                    .serialNumber("302503097311715737064467329723821046857")
                                    .issuerDN("CN=Ensured Document Signing CA, O=Ensured B.V., L=Heerhugowaard, ST=Noord-Holland, C=NL")
                                    .subjectDN("EMAILADDRESS=signature@esignum.io, CN=Afdeling beheer, OU=Afdeling beheer, O=Sphereon B.V., ST=Utrecht, C=NL")
                                    .notBefore(Instant.ofEpochSecond(1658138695))
                                    .notAfter(Instant.ofEpochSecond(1658138695))
                                )
                            )
                            .date(Instant.ofEpochSecond(1658138695))
                            .binding(ConfigKeyBinding()
                                .kid(KID_REST)
                                .keyProviderId(KID_REST)
                            )
                        )
                )
            } returns JSON.getDefault().mapper.readValue(this::class.java.classLoader.getResource("mergeSignatureResponse.json"), MergeSignatureResponse::class.java)

            val keyProvider = spyk(RestKeyProviderService(constructKeyProviderSettings(), constructRestClientConfig()))
            val restSignatureService = spyk(RestSignatureService(keyProvider, signingApiMock));

            return restSignatureService
        }

        @BeforeAll
        @JvmStatic
        internal fun init() {
            restSignatureService = setupSignatureProviderMock()
        }
    }
}
